import React,{useState} from "react";
import Button from "./Button"



const App = ()=>{
    const [number, setNumber]= useState(2)
    return <div>
      <h1> {number}</h1>  
      <Button onClick={ ()=> setNumber(number+1) } name="Add"></Button> 
      <Button onClick={ ()=> setNumber(number-1) } name="Sub"></Button> 
      <Button onClick={ ()=> setNumber(number*0) } name="Reset"></Button>/>
    </div>
}
export default App;
